-- Table structure for coupon
-- ----------------------------
DROP TABLE IF EXISTS `coupon`;
CREATE TABLE `coupon` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `store_id` int(10) NOT NULL DEFAULT '0' COMMENT '店铺',
  `name` varchar(95) NOT NULL DEFAULT '' COMMENT '优惠券名字',
  `coupon_type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '优惠券类型：0=平台通用优惠券，1=店铺优惠券，2=会员卡优惠券',
  `send_type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '发放类型 0签到赠送 1 按用户发放 2 免费领取 3 线下发放',
  `money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '优惠券金额',
  `condition` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '使用条件',
  `create_num` int(10) NOT NULL DEFAULT '0' COMMENT '发放数量',
  `send_num` int(10) NOT NULL DEFAULT '0' COMMENT '已领取数量',
  `use_num` int(10) NOT NULL DEFAULT '0' COMMENT '已使用',
  `send_start_time` timestamp NULL DEFAULT NULL COMMENT '发放开始时间',
  `send_end_time` timestamp NULL DEFAULT NULL COMMENT '发放结束时间',
  `use_start_time` timestamp NULL DEFAULT NULL COMMENT '使用开始时间',
  `use_end_time` timestamp NULL DEFAULT NULL COMMENT '使用结束时间',
  `created_at` timestamp NULL DEFAULT NULL COMMENT '添加时间',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态：0=无效，1=有效',
  `coupon_info` varchar(255) NOT NULL DEFAULT '' COMMENT '优惠券描述',
  `province_id` int(10) NOT NULL DEFAULT '0' COMMENT '省',
  `city_id` int(10) NOT NULL DEFAULT '0' COMMENT '市',
  `district_id` int(10) NOT NULL DEFAULT '0',
  `updated_at` timestamp NULL DEFAULT NULL,
  `cat1` int(10) NOT NULL DEFAULT '0',
  `cat2` int(10) NOT NULL DEFAULT '0',
  `cat3` int(10) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COMMENT='优惠券';

