  `shop_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '本店价',
  `is_on_sale` tinyint(1) NOT NULL DEFAULT '0' COMMENT '上架状态:0=下架,1=上架,2=违规下架',
  `on_time` timestamp NULL DEFAULT NULL COMMENT '上架时间',
  `weigh` mediumint(8) NOT NULL DEFAULT '0' COMMENT '权重',
  `is_rec` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否推荐：0=否，1=是',
  `is_hot` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否热卖:0=否,1=是',
  `distribut` decimal(8,2) NOT NULL DEFAULT '0.00' COMMENT '佣金用于分销分成',
  `spec_list` varchar(900) NOT NULL DEFAULT '' COMMENT '规格集合',
  `status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '审核状态:0待审核1审核通过2审核失败',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `cover` varchar(255) NOT NULL DEFAULT '' COMMENT '封面图',
  `content` text COMMENT '商品描述',
  `spu` text COMMENT '属性参数',
  `exchange_integral` int(10) NOT NULL DEFAULT '0' COMMENT 'COMMENT ''积分兑换：0不参与积分兑换',
  `give_integral` int(10) NOT NULL DEFAULT '0' COMMENT '购买商品赠送积分',
  `deleted_at` timestamp NULL DEFAULT NULL,
  `use_integral` int(10) NOT NULL DEFAULT '0' COMMENT '可使用麦穗抵扣',
  `give_account` int(10) DEFAULT '0' COMMENT '赠送麦穗',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=28 DEFAULT CHARSET=utf8;

