-- ----------------------------
-- Table structure for order
-- ----------------------------
DROP TABLE IF EXISTS `order`;
CREATE TABLE `order` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `order_sn` varchar(45) DEFAULT '' COMMENT '订单号',
  `master_order_sn` varchar(45) DEFAULT '' COMMENT '主订单号',
  `user_id` int(10) DEFAULT '0' COMMENT '用户',
  `order_status` tinyint(1) DEFAULT '0' COMMENT '订单状态.0待确认，1已确认，2已收货，3已取消，4已完成，5已作废',
  `shipping_status` tinyint(1) DEFAULT '0' COMMENT '发货状态:0=未发货，1=已发货，2=部分发货',
  `pay_status` tinyint(1) DEFAULT '0' COMMENT '支付状态.0待支付，1已支付，2支付失败，3已退款，4拒绝退款,5已取消',
  `consignee` varchar(45) DEFAULT '' COMMENT '收货人',
  `province_id` int(10) DEFAULT '0' COMMENT '省',
  `city_id` int(10) DEFAULT '0' COMMENT '市',
  `district_id` int(10) DEFAULT '0' COMMENT '区县',
  `address` varchar(255) DEFAULT '' COMMENT '详细地址',
  `mobile` varchar(25) DEFAULT '' COMMENT '联系电话',
  `pay_type` tinyint(20) DEFAULT '0' COMMENT '支付方式:0=会员卡,1=支付宝,2=微信',
  `goods_price` decimal(10,2) DEFAULT '0.00' COMMENT '商品总价',
  `order_amount` decimal(10,2) DEFAULT '0.00' COMMENT '应付款金额',
  `created_at` timestamp NULL DEFAULT NULL COMMENT '下单时间',
  `pay_time` timestamp NULL DEFAULT NULL COMMENT '支付时间',
  `confirm_time` timestamp NULL DEFAULT NULL COMMENT '收货确认时间',
  `transaction_id` varchar(45) DEFAULT '' COMMENT '第三方支付流水号',
  `user_note` varchar(255) DEFAULT '' COMMENT '用户备注',
  `admin_note` varchar(255) DEFAULT '' COMMENT '管理员备注',
  `store_id` int(10) DEFAULT '0' COMMENT '店铺',
  `deleted_at` timestamp NULL DEFAULT NULL COMMENT '用户假删除标识',
  `area` varchar(255) DEFAULT '' COMMENT '省市区',
  `shipping_code` varchar(45) DEFAULT '' COMMENT '配送方式编号：ems=快递配送，same_city=同城配送，in_shop=到点自取',
  `shipping_name` varchar(45) DEFAULT '' COMMENT '配送方式名称',
  `shipping_price` decimal(6,2) DEFAULT '0.00' COMMENT '邮费',
  `user_account` int(10) DEFAULT '0' COMMENT '使用麦穗',
  `user_account_money` decimal(8,2) DEFAULT '0.00' COMMENT '麦穗抵扣金额',
  `coupon_price` decimal(8,2) DEFAULT '0.00' COMMENT '优惠金额',
  `total_amount` decimal(10,2) DEFAULT '0.00' COMMENT '订单总价',
  `shipping_time` timestamp NULL DEFAULT NULL COMMENT '发货时间',
  `is_comment` tinyint(1) DEFAULT '0' COMMENT '是否评价（0：未评价；1：已评价）',
  `order_prom_id` int(10) DEFAULT '0' COMMENT '订单活动id',
  `order_prom_type` tinyint(2) DEFAULT '0' COMMENT '订单类型：0默认1抢购2团购3优惠4预售5虚拟6拼团',
  `order_prom_amount` decimal(10,2) DEFAULT '0.00' COMMENT '订单活动优惠金额',
  `coupon_ids` varchar(255) DEFAULT '' COMMENT '优惠券id数组',
  `shipper_code` varchar(255) DEFAULT '' COMMENT '快递公司编码',
  `logistic_code` varchar(255) DEFAULT '' COMMENT '物流单号',
  `shipper_name` varchar(255) DEFAULT '' COMMENT '快递名称',
  `pick_code` varchar(255) DEFAULT '' COMMENT '取货码',
  `deleted` tinyint(1) DEFAULT '0' COMMENT '用户假删除: 1=删除, 0=未删除',
  `user_confirm_time` timestamp NULL DEFAULT NULL COMMENT '确认收货时间',
  `is_under` tinyint(1) DEFAULT '0' COMMENT '是否线下付款：0=否，1=是',
  `discount_price` decimal(10,2) DEFAULT '0.00' COMMENT '打折金额',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=94 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of order
-- ----------------------------

-- ----------------------------
-- Table structure for order_goods
-- ----------------------------
DROP TABLE IF EXISTS `order_goods`;
CREATE TABLE `order_goods` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `order_id` int(10) NOT NULL DEFAULT '0' COMMENT '订单id',
  `goods_id` int(10) NOT NULL DEFAULT '0' COMMENT '商品id',
  `goods_name` varchar(90) NOT NULL DEFAULT '' COMMENT '商品名称',
  `goods_num` smallint(5) NOT NULL DEFAULT '0' COMMENT '购买数量',
  `goods_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '本店价',
  `spec_key` varchar(255) NOT NULL DEFAULT '' COMMENT '商品规格key',
  `spec_key_name` varchar(255) NOT NULL DEFAULT '' COMMENT '规格对应的中文名字',
  `is_send` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否发货：0未发货，1已发货，2已换货，3已退货',
  `store_id` int(10) NOT NULL DEFAULT '0' COMMENT '商家店铺id',
  `is_checkout` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否已跟商家结账0 否1是',
  `distribut` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '三级分销的金额',
  `deleted_at` timestamp NULL DEFAULT NULL COMMENT '软删除',
  `give_integral` int(10) DEFAULT '0' COMMENT '赠送店铺积分',
  `give_account` int(10) DEFAULT '0' COMMENT '赠送麦穗',
  `is_comment` tinyint(1) DEFAULT '0' COMMENT '是否评价:0=否，1=是',
  `prom_type` tinyint(1) DEFAULT '0' COMMENT '活动类型：0 普通订单,1 限时抢购, 2 团购 , 3 促销优惠, 4 预售',
  `prom_id` tinyint(1) DEFAULT '0' COMMENT '活动id',
  `delivery_id` int(10) DEFAULT '0' COMMENT '发货单ID',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=111 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of order_goods
-- ----------------------------

-- ----------------------------
-- Table structure for other_order
-- ----------------------------
DROP TABLE IF EXISTS `other_order`;
CREATE TABLE `other_order` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `user_id` int(10) DEFAULT '0' COMMENT '用户',
  `pay_type` tinyint(1) DEFAULT '0' COMMENT '支付方式:0=余额,1=支付宝,2=微信',
  `pay_status` tinyint(1) DEFAULT '0' COMMENT '支付状态.0待支付，1已支付，2支付失败',
  `order_sn` varchar(45) DEFAULT '' COMMENT '订单号',
  `created_at` timestamp NULL DEFAULT NULL,
  `pay_time` timestamp NULL DEFAULT NULL,
  `commentable_type` varchar(45) DEFAULT '' COMMENT '类型：store=店铺',
  `commentable_id` int(10) DEFAULT '0',
  `remark` varchar(255) DEFAULT '' COMMENT '备注',
  `extra` varchar(255) DEFAULT '' COMMENT '其他',
  `order_amount` decimal(10,2) DEFAULT '0.00' COMMENT '订单应付金额',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=11 DEFAULT CHARSET=utf8;

