-- ----------------------------
-- Table structure for store
-- ----------------------------
DROP TABLE IF EXISTS `store`;
CREATE TABLE `store` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `shop_name` varchar(255) DEFAULT '' COMMENT '店铺名称',
  `license_front` varchar(255) DEFAULT '' COMMENT '营业执照正面',
  `contacts_name` varchar(255) DEFAULT '' COMMENT '联系人姓名',
  `contacts_mobile` varchar(15) DEFAULT '' COMMENT '联系人手机',
  `created_at` timestamp NULL DEFAULT NULL COMMENT '创建时间',
  `updated_at` timestamp NULL DEFAULT NULL COMMENT '更新时间',
  `logo` varchar(255) DEFAULT '' COMMENT '店铺图片',
  `address` varchar(255) DEFAULT '' COMMENT '详细地址',
  `province_id` int(10) DEFAULT '0' COMMENT '省',
  `city_id` int(10) DEFAULT '0' COMMENT '市',
  `district_id` int(10) DEFAULT '0' COMMENT '区/县',
  `weigh` int(10) DEFAULT '0' COMMENT '权重',
  `is_rec` tinyint(1) DEFAULT '0' COMMENT '是否推荐:0=否,1=是',
  `status` tinyint(1) DEFAULT '2' COMMENT '状态:0=关闭,1=通过,2=未审核',
  `handle_time` timestamp NULL DEFAULT NULL COMMENT '审核时间',
  `reason` varchar(255) DEFAULT '' COMMENT '原因',
  `license_number` varchar(255) DEFAULT '' COMMENT '营业执照号码',
  `customer_service` varchar(25) DEFAULT '' COMMENT '客服电话',
  `account` decimal(10,2) DEFAULT '0.00' COMMENT '店铺金额',
  `frozen_account` decimal(10,2) DEFAULT '0.00' COMMENT '冻结金额',
  `is_frozen` tinyint(1) DEFAULT '0' COMMENT '是否冻结资金:0=否,1=是',
  `map_city_id` int(10) DEFAULT '0' COMMENT '地图城市id',
  `lat` varchar(255) DEFAULT '' COMMENT '纬度',
  `lng` varchar(255) DEFAULT '' COMMENT '经度',
  `idcard_front` varchar(255) DEFAULT '' COMMENT '身份证正面',
  `idcard_back` varchar(255) DEFAULT '' COMMENT '身份证背景',
  `idcard_num` varchar(25) DEFAULT '' COMMENT '身份证号码',
  `city` varchar(25) DEFAULT '' COMMENT '城市代码',
  `city_name` varchar(25) DEFAULT '' COMMENT '城市名称',
  `notice` varchar(255) DEFAULT '' COMMENT '店铺公告',
  `collect_num` mediumint(8) DEFAULT '0' COMMENT '关注量',
  `pedding_account` decimal(10,2) DEFAULT '0.00' COMMENT '待结算资金',
  `store_start_time` time DEFAULT NULL COMMENT '店铺营业时间',
  `store_end_time` time DEFAULT NULL,
  `deliver_region` varchar(255) DEFAULT '' COMMENT '店铺默认配送区域',
  `deleted_at` timestamp NULL DEFAULT NULL,
  `email` varchar(45) DEFAULT '' COMMENT '邮箱',
  `type` tinyint(1) DEFAULT '0' COMMENT '商家类型：0=个人店铺，1=企业店铺',
  `send_type` tinyint(1) DEFAULT '0' COMMENT '发货类型：0=国内商家自己发货，1=国内商品麦达汇发货，2=进口商品国内发货，3=进口商品国外发货，4=到店消费店铺',
  `bank_num` varchar(255) DEFAULT '' COMMENT '结算账户',
  `bank_front` varchar(255) DEFAULT '' COMMENT '银行卡正面',
  `bank_back` varchar(255) DEFAULT '' COMMENT '银行卡反面',
  `brand_image` varchar(255) DEFAULT '' COMMENT '品牌授权书',
  `trademark_image` varchar(255) DEFAULT '' COMMENT '商标证书',
  `food_image` varchar(255) DEFAULT '' COMMENT '食品经营许可证',
  `door_image` varchar(255) DEFAULT '' COMMENT '门头/仓库照片',
  `other_image` varchar(255) DEFAULT '' COMMENT '其他资质',
  `user_id` int(10) DEFAULT '0' COMMENT '用户id',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=21 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of store
-- ----------------------------

