CREATE TABLE `store_account_log` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `store_id` int(10) NOT NULL DEFAULT '0' COMMENT '店铺',
  `before_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '变动前金额',
