  `order_id` int(10) NOT NULL DEFAULT '0',
  `type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '类型:0=收入，1=支出',
  `source` tinyint(1) NOT NULL DEFAULT '0' COMMENT '来源：0=订单结算,1=发布大喇叭',
