-- ----------------------------
-- Table structure for store_withdrawals
-- ----------------------------
DROP TABLE IF EXISTS `store_withdrawals`;
CREATE TABLE `store_withdrawals` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '商家提现申请表',
  `store_id` int(11) NOT NULL DEFAULT '0' COMMENT '商家id',
  `created_at` timestamp NULL DEFAULT NULL COMMENT '申请日期',
  `pay_time` timestamp NULL DEFAULT NULL COMMENT '支付时间',
  `check_time` timestamp NULL DEFAULT NULL COMMENT '审核时间',
  `money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '提现金额',
  `bank_name` varchar(100) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '银行名称 如支付宝 微信 中国银行 农业银行等',
  `bank_card` varchar(100) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '银行账号',
  `realname` varchar(100) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '银行账户名 可以是支付宝可以其他银行',
  `remark` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '提现备注',
  `status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '状态：-2删除作废-1审核失败0申请中1审核通过2已转款完成',
  `pay_code` varchar(100) NOT NULL DEFAULT '' COMMENT '付款对账流水号',
  `taxfee` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '手续费',
  `error_code` varchar(100) NOT NULL DEFAULT '' COMMENT '转款失败错误代码',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of store_withdrawals
-- ----------------------------

-- ----------------------------
-- Table structure for team_activity
-- ----------------------------
DROP TABLE IF EXISTS `team_activity`;
CREATE TABLE `team_activity` (
  `team_id` int(10) NOT NULL AUTO_INCREMENT,
  `act_name` varchar(255) DEFAULT '' COMMENT '拼团活动标题',
  `team_type` tinyint(1) DEFAULT '0' COMMENT '拼团活动类型,0分享团1佣金团2抽奖团',
  `time_limit` int(11) DEFAULT '0' COMMENT '成团有效期。单位（秒)',
  `team_price` decimal(10,2) DEFAULT '0.00' COMMENT '拼团价',
  `needer` int(10) DEFAULT '2' COMMENT '需要成团人数',
  `goods_name` varchar(255) DEFAULT '' COMMENT '商品名称',
  `goods_id` int(11) DEFAULT '0' COMMENT '商品id',
  `item_id` int(10) DEFAULT '0' COMMENT '商品规格id',
  `bonus` decimal(10,2) DEFAULT '0.00' COMMENT '团长佣金',
  `stock_limit` int(11) DEFAULT '0' COMMENT '抽奖限量',
  `buy_limit` smallint(4) DEFAULT '0' COMMENT '单次团购买限制数0为不限制',
  `sales_sum` int(10) unsigned DEFAULT '0' COMMENT '已拼多少件',
  `virtual_num` int(10) DEFAULT '0' COMMENT '虚拟销售基数',
  `share_title` varchar(100) DEFAULT NULL COMMENT '分享标题',
  `share_desc` varchar(255) DEFAULT NULL COMMENT '分享描述',
  `share_img` varchar(150) DEFAULT NULL COMMENT '分享图片',
  `store_id` int(11) DEFAULT '0' COMMENT '商家id',
  `sort` smallint(4) unsigned NOT NULL DEFAULT '0' COMMENT '排序',
  `is_recommend` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否推荐',
  `status` tinyint(1) DEFAULT '0' COMMENT '0待审核1正常2拒绝3关闭',
  `is_lottery` tinyint(1) DEFAULT '0' COMMENT '是否已经抽奖.1是，0否',
  PRIMARY KEY (`team_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='拼团活动表';

-- ----------------------------
-- Records of team_activity
-- ----------------------------

-- ----------------------------
-- Table structure for team_follow
-- ----------------------------
DROP TABLE IF EXISTS `team_follow`;
CREATE TABLE `team_follow` (
  `follow_id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `follow_user_id` int(11) DEFAULT '0' COMMENT '参团会员id',
  `follow_user_nickname` varchar(100) DEFAULT NULL COMMENT '参团会员昵称',
  `follow_user_head_pic` varchar(255) DEFAULT NULL COMMENT '会员头像',
  `follow_time` int(11) DEFAULT '0' COMMENT '参团时间',
  `order_id` int(11) DEFAULT '0' COMMENT '订单id',
  `found_id` int(10) DEFAULT '0' COMMENT '开团ID',
  `found_user_id` int(11) DEFAULT '0' COMMENT '开团人user_id',
  `team_id` int(10) DEFAULT '0' COMMENT '拼团活动id',
  `status` tinyint(1) DEFAULT '0' COMMENT '参团状态0:待拼单(表示已下单但是未支付)1拼单成功(已支付)2成团成功3成团失败',
  `is_win` tinyint(1) DEFAULT '0' COMMENT '抽奖团是否中奖',
  PRIMARY KEY (`follow_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='参团表';

-- ----------------------------
-- Records of team_follow
-- ----------------------------

-- ----------------------------
-- Table structure for team_found
-- ----------------------------
DROP TABLE IF EXISTS `team_found`;
CREATE TABLE `team_found` (
  `found_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `found_time` int(11) DEFAULT '0' COMMENT '开团时间',
  `found_end_time` int(11) DEFAULT '0' COMMENT '成团截止时间',
  `user_id` int(11) DEFAULT '0' COMMENT '团长id',
  `team_id` int(10) DEFAULT '0' COMMENT '拼团活动id',
  `nickname` varchar(100) DEFAULT NULL COMMENT '团长用户名昵称',
  `head_pic` varchar(100) DEFAULT '' COMMENT '团长头像',
  `order_id` int(11) DEFAULT '0' COMMENT '团长订单id',
  `join` int(8) DEFAULT '1' COMMENT '已参团人数',
  `need` int(8) DEFAULT '1' COMMENT '需多少人成团',
  `price` decimal(10,2) DEFAULT '0.00' COMMENT '拼团价格',
  `goods_price` decimal(10,2) DEFAULT '0.00' COMMENT '商品原价',
  `status` tinyint(1) DEFAULT '0' COMMENT '拼团状态0:待开团(表示已下单但是未支付)1:已经开团(团长已支付)2:拼团成功,3拼团失败',
  `bonus_status` tinyint(1) DEFAULT '0' COMMENT '团长佣金领取状态：0无1领取',
  `store_id` int(11) unsigned DEFAULT '0' COMMENT '店铺id',
  PRIMARY KEY (`found_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='开团表';

-- ----------------------------
-- Records of team_found
-- ----------------------------

-- ----------------------------
-- Table structure for tyfon
-- ----------------------------
DROP TABLE IF EXISTS `tyfon`;
CREATE TABLE `tyfon` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `commentable_type` varchar(25) DEFAULT 'user' COMMENT '发布者角色：user=用户，store=商家',
  `commentable_id` int(10) DEFAULT '0' COMMENT '发布者id',
  `title` varchar(95) DEFAULT '' COMMENT '标题',
  `content` text COMMENT '内容',
  `images` text COMMENT '图片',
  `cat1` smallint(5) DEFAULT '0',
  `cat2` smallint(5) DEFAULT '0',
  `cat3` smallint(5) DEFAULT '0' COMMENT '分类',
  `mobile` varchar(25) DEFAULT '' COMMENT '联系电话',
  `province_id` smallint(5) DEFAULT '0' COMMENT '省',
  `city_id` smallint(5) DEFAULT '0' COMMENT '市',
  `district_id` smallint(5) DEFAULT '0' COMMENT '区/县',
  `detail_address` varchar(255) DEFAULT '' COMMENT '详细地址',
  `click_num` mediumint(8) DEFAULT '0' COMMENT '点击量',
  `comment_num` mediumint(8) DEFAULT '0' COMMENT '评价数',
  `created_at` timestamp NULL DEFAULT NULL COMMENT '创建时间',
  `updated_at` timestamp NULL DEFAULT NULL,
  `goods_id` int(10) DEFAULT '0' COMMENT '商品id',
  `like_num` mediumint(8) DEFAULT '0' COMMENT '点赞量',
  PRIMARY KEY (`id`)
