-- ----------------------------
-- Table structure for tyfon_category
-- ----------------------------
DROP TABLE IF EXISTS `tyfon_category`;
CREATE TABLE `tyfon_category` (
  `id` smallint(5) NOT NULL AUTO_INCREMENT,
  `pid` smallint(5) NOT NULL DEFAULT '0' COMMENT '上级id',
  `name` varchar(90) NOT NULL DEFAULT '' COMMENT '分类名称',
  `weigh` tinyint(4) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=38 DEFAULT CHARSET=utf8;

