  `id` int(10) NOT NULL AUTO_INCREMENT,
  `user_id` int(10) NOT NULL DEFAULT '0' COMMENT '评论人',
  `tyfon_id` int(10) NOT NULL DEFAULT '0' COMMENT '喇叭id',
