-- ----------------------------
-- Table structure for users
-- ----------------------------
DROP TABLE IF EXISTS `users`;
CREATE TABLE `users` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `mobile` varchar(25) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '手机',
  `name` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `email` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT '',
  `password` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT '',
  `remember_token` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `real_name` varchar(25) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '真实姓名',
  `idcard_front` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '身份证正面',
  `idcard_back` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '身份证反面',
  `idcard_num` varchar(25) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '身份证号码',
  `bank_num` varchar(45) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '银行卡号',
  `payment_password` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '支付密码',
  `avatar` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '头像',
  `gender` tinyint(1) DEFAULT '0' COMMENT '性别:0=保密，1=男，2=女',
  `sign` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '个性签名',
  `birthday` date DEFAULT NULL COMMENT '生日',
  `account` decimal(10,2) DEFAULT '0.00' COMMENT '麦穗',
  `frozen_account` decimal(10,2) DEFAULT '0.00' COMMENT '冻结金额',
  `level` tinyint(1) DEFAULT '0' COMMENT '级别',
  `referral_code` varchar(45) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '推荐码',
  `referral_img` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '推荐二维码',
  `first_leader` int(10) DEFAULT '0' COMMENT '第一个上级',
  `second_leader` int(10) DEFAULT '0' COMMENT '第二个上级',
  `third_leader` int(10) DEFAULT '0' COMMENT '第三个上级',
  `community_code` varchar(45) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '小区长邀请码',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=34 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- ----------------------------
-- Records of users
-- ----------------------------

-- ----------------------------
-- Table structure for user_coupon
-- ----------------------------
DROP TABLE IF EXISTS `user_coupon`;
CREATE TABLE `user_coupon` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `coupon_id` int(10) NOT NULL DEFAULT '0' COMMENT '优惠券id',
  `user_id` int(10) NOT NULL DEFAULT '0' COMMENT '用户id',
  `order_id` int(10) NOT NULL DEFAULT '0' COMMENT '订单id',
  `store_id` int(10) NOT NULL DEFAULT '0' COMMENT '店铺id',
  `use_time` timestamp NULL DEFAULT NULL COMMENT '使用时间',
  `send_time` timestamp NULL DEFAULT NULL COMMENT '发放时间',
  `status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0未使用1已使用2已过期',
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=6 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of user_coupon
-- ----------------------------

-- ----------------------------
-- Table structure for user_message
-- ----------------------------
DROP TABLE IF EXISTS `user_message`;
CREATE TABLE `user_message` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '用户id',
  `message_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '消息id',
  `category` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '消息分类：0系统消息，1物流通知，2优惠促销，3商品提醒，4我的资产，5商城好店',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '查看状态：0未查看，1已查看',
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`) USING BTREE,
  KEY `message_id` (`message_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of user_message
-- ----------------------------

-- ----------------------------
-- Table structure for withdrawals
-- ----------------------------
DROP TABLE IF EXISTS `withdrawals`;
CREATE TABLE `withdrawals` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '提现申请表',
  `user_id` int(11) DEFAULT '0' COMMENT '用户id',
  `money` decimal(10,2) DEFAULT '0.00' COMMENT '提现金额',
  `created_at` timestamp NULL DEFAULT NULL COMMENT '申请时间',
  `check_time` timestamp NULL DEFAULT NULL COMMENT '审核时间',
  `pay_time` timestamp NULL DEFAULT NULL COMMENT '支付时间',
  `refuse_time` timestamp NULL DEFAULT NULL COMMENT '拒绝时间',
  `bank_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT '' COMMENT '银行名称 如支付宝 微信 中国银行 农业银行等',
  `bank_card` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT '' COMMENT '银行账号或支付宝账号',
  `realname` varchar(100) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT '' COMMENT '提款账号真实姓名',
  `remark` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT '' COMMENT '提现备注',
  `taxfee` decimal(10,2) DEFAULT '0.00' COMMENT '税收手续费',
  `status` tinyint(1) DEFAULT '0' COMMENT '状态：-2删除作废-1审核失败0申请中1审核通过2付款成功3付款失败',
  `pay_code` varchar(100) DEFAULT NULL COMMENT '付款对账流水号',
  `error_code` varchar(255) DEFAULT NULL COMMENT '付款失败错误代码',
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of withdrawals
-- ----------------------------
